







def maxProduct(nums):
    """
    :type nums: List[int]
    :rtype: int
    """
    if len(nums) == 0:
        return False
    if len(nums) == 1:
        return nums[0]
    mx = nums[0]
    max_so_far = nums[0]
    for number in range(len(nums)):
        max_so_far = nums[number]
        for second in range(number, len(nums)):
            if number != second:
                max_so_far = max_so_far * nums[second]
                mx = max(mx, max_so_far)
            else:
                mx = max(mx, nums[number])
    print(mx)
